import React, { Component } from 'react';
import './App.css';
import { profile1 } from './profileData';

class App extends Component{

  render(){
    console.log("profile1", profile1);

    return(
      <div >
        {/* < div className="profile-card-1" > */}
                    < img src="data:img/jpeg;base64,"
                      alt="Avatar" className="profile" />
                      <div>
                     {profile1.map(item => (<div className="category">
                        {/* <h2 style ={{ "font-size" :"40px" }} />  */}
                       <div>
                       <div>
                       <span className="nameStyle"> {item.name} </span>
                        </div>

                        <div>
                        <span className="roleStyle"> {item.role} </span> 
                        </div>

                        <span className="keyStyle"> {item.key1} </span>
                        {item.description1} 
                        {item.key2} <br/>
                        {item.description2} 
                        {item.key3} <br/>
                        {item.description3} 
                        {item.key4} <br/>
                        {item.description4} 
                        {item.key5}
                        {item.description5}




</div>


            </div>))}
            </div>


      </div>
    )
  }
}

export default App;
